/td>\n</tr>\n<tr>\n	<td>type</td>\n	<td>country</td>\n	<td>USA</td>\n</tr>\n<tr>\n	<td>type</td>\n	<td>zip</td>\n	<td>92057</td>\n</tr>\n<tr>\n	<td>clickAndWait</td>\n	<td>class=adMedFwdButton</td>\n	<td>Submit</td>\n</tr>\n<tr>\n	<td>pause</td>\n	<td>5000</td>\n	<td>5000</td>\n</tr>\n<tr>\n	<td>clickAndWait</td>\n	<td>class=adMedFwdButton</td>\n	<td>My Listings</td>\n</tr>\n\n</tbody></table>\n</body>\n</html>\n'),(85,85,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Strict//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\" xml:lang=\"en\" lang=\"en\">\n<head profile=\"http://selenium-ide.openqa.org/profiles/test-case\">\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\" />\n<link rel=\"selenium.base\" href=\"\" />\n<title>6.RE- VerifyListingExists</title>\n</head>\n<body>\n<table cellpadding=\"1\" cellspacing=\"1\" border=\"1\">\n<thead>\n<tr><td rowspan=\"1\" colspan=\"3\">6.RE- VerifyListingExists</td></tr>\n</thead><tbody>\n<!--Verify that the created listing Exists-->\n<tr>\n	<td>verifyTextPresent</td>\n	<td>${myVarPropertyName} Cypris Hill Lane</td>\n	<td></td>\n</tr>\n<tr>\n	<td>clickAndWait</td>\n	<td>//input[@value=\'Members\']</td>\n	<td></td>\n</tr>\n\n</tbody></table>\n</body>\n</html>\n'),(86,86,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Strict//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\" xml:lang=\"en\" lang=\"en\">\n<head profile=\"http://selenium-ide.openqa.org/profiles/test-case\">\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\" />\n<link rel=\"selenium.base\" href=\"\" />\n<title>7.RE- EditYourMarketingProfile</title>\n</head>\n<body>\n<table cellpadding=\"1\" cellspacing=\"1\" border=\"1\">\n<thead>\n<tr><td rowspan=\"1\" colspan=\"3\">7.RE- EditYourMarketingProfile</td></tr>\n</thead><tbody>\n<!