ang=\"en\" lang=\"en\">\n<head profile=\"http://selenium-ide.openqa.org/profiles/test-case\">\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\" />\n<link rel=\"selenium.base\" href=\"\" />\n<title>8.RE- SavedSearches</title>\n</head>\n<body>\n<table cellpadding=\"1\" cellspacing=\"1\" border=\"1\">\n<thead>\n<tr><td rowspan=\"1\" colspan=\"3\">8.RE- SavedSearches</td></tr>\n</thead><tbody>\n<!--Do a new Search and Save the search then Verify the Search.-->\n<tr>\n	<td>clickAndWait</td>\n	<td>class=buttonClassRESmall</td>\n	<td>Search</td>\n</tr>\n<tr>\n	<td>clickAndWait</td>\n	<td>//input[@value=\'Search\' and @type=\'submit\']</td>\n	<td></td>\n</tr>\n<tr>\n	<td>clickAndWait</td>\n	<td>link=Save Search</td>\n	<td></td>\n</tr>\n<tr>\n	<td>type</td>\n	<td>name</td>\n	<td>Save Search #${myVarSavedSearchNumber}</td>\n</tr>\n<tr>\n	<td>click</td>\n	<td>class=buttonClassREFlow</td>\n	<td>Save</td>\n</tr>\n<tr>\n	<td>pause</td>\n	<td>5000</td>\n	<td>5000</td>\n</tr>\n<!--Verify Search Saved-->\n<tr>\n	<td>clickAndWait</td>\n	<td>link=Saved Search Manager</td>\n	<td></td>\n</tr>\n<tr>\n	<td>verifyTextPresent</td>\n	<td>Save Search #${myVarSavedSearchNumber}</td>\n	<td></td>\n</tr>\n<!--Run Search-->\n<tr>\n	<td>clickAndWait</td>\n	<td>//img[@alt=\'Run Saved Search\']</td>\n	<td></td>\n</tr>\n\n</tbody></table>\n</body>\n</html>\n');
